import * as actionTypes from "./actiontypes";
import axios from "axios";

export const authStart = () => {
  return {
    type: actionTypes.AUTH_START,
  };
};

export const authSuccess = (authData) => {
  return {
    type: actionTypes.AUTH_SUCCESS,
    authData: authData,
  };
};

export const authFail = (error) => {
  return {
    type: actionTypes.AUTH_FAIL,
    error: error,
  };
};

export const auth = (email, password, name, phone, business) => {
  return (dispatch) => {
    dispatch(authStart());
    const authData = {
      email: email,
      password: password,
      returnSecureToken: true,
    };
    axios.post(
      "https://identitytoolkit.googleapis.com/v1/accounts:signInWithCustomToken?key=[AIzaSyDTVT2Quz8E1XJ_izdYFlSrye94CFR-yxo]"
    );
  };
};
